import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom'
import { Provider } from 'react-redux'
import store from './store.js'

function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
      <div>
      <h1>Hello World</h1>
      </div>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
